import React from "react";
import { NavLink } from "react-router-dom";

const Menu = () => {
    return (
        <>
           <NavLink activeCl to="/"> About Us </NavLink>
           <NavLink to="/contact"> Contact </NavLink>
           <a href="/">About Us</a>
           <a href="/contact">Contact</a>
        </>
    );
};

export default Menu;
